import React from "react";
import ToolBar from "../Components/ToolBar";

class Home extends React.Component {
  render() {
    return (
      <div style={{ display: "flex", flexDirection: "column", overflow: "auto" }}>
        <div>
          <ToolBar />
        </div>
        <div>
          <h1>Helo World</h1>
        </div>
      </div>
    );
  }
}

export default Home;
